import React, { Component } from 'react';
import {NavLink} from 'react-router-dom'


class Navigation2 extends Component {
  render() {
    console.log()
    return (
      <div className="linksContainer">
        <NavLink className="linkStyle"  to="/Pranyama">Name</NavLink><br/>
        <NavLink className="linkStyle"  to="/Yama2">Links</NavLink> <br/>
        <NavLink className="linkStyle"  to="/Yama3">Schedule</NavLink><br/>
        <NavLink className="linkStyle"  to="/Niyama2">Blog</NavLink><br/>
      </div>
    );
  }
}

export default Navigation2;
